definition.postcondition:
- the block is on the former top block of the pile, i. e., now it is the top block of the pile;
- the block is clear;
- the hand is empty.

definition.precondition:
- the hand must be empty;
- the pile from where the block will be taken must be at the same table as the hand;
- the block must be the top one of the pile.

- the block must be at the same table as the hand;
- the block must be clear, i.e., with no block on it;
- the hand must be empty, i.e., without holding any block.

- the hand must be at the origin table;
- the hand must have access to the destination table;
- the destination table must be availabe, i. e., there must be no hand at it.
